📢Онлайн-конкурс «Молодым о Героях!» продлевает прием заявок! 🇷🇺

Не успел подать заявку, но мечтаешь стать участником Парада Победы в Самарской области?

❗️Тогда спешим сообщить, что регистрация на онлайн-конкурс «Молодым о Героях! продлена до 1 мая (включительно).

А также напоминаем, чтобы принять участие необходимо:

1⃣ Выполнить творческую работу в одном из направлений:

– Рисунок, графика;
– Стихи, песни, театральные постановки;
– Презентации, эссе, статьи;
– Поделки, макеты, композиции;

2⃣ Опубликовать пост в социальных сетях (ВКонтакте или Одноклассниках) с рассказом о герое Великой Отечественной войны. Не забудь внести в публикацию видеопредставление (ФИО, место проживания), историю подвига героя, значение Дня Победы для тебя и поздравление с праздником;

3⃣ Обязательно использовать хештеги: #Победа80 #МолодымоГероях и заполнить форму по ссылке: clck.ru/3LgNt4

Успей подать заявку и стать частью значимого события! ❤️

